import React, { Component } from 'react'

export default class Events extends Component {
  render(props) {
    const events=this.props.events;
  const eventItems=events.map(eventItem => <tr className="event_div"><td className="time">{eventItem.match_time} &nbsp; &nbsp;</td><td><p className="event">{eventItem.participant1} &nbsp; <b>vs</b> &nbsp; {eventItem.participant2}</p></td></tr>);
    return (
      <div>
        {eventItems}
      </div>
    )
  }
}
